<p><hi rend="bold">ئۇيغۇرچە ۋىكىپىدىيە</hi> ياكى <hi rend="bold">29 - قەھرىتان</hi> ۋە ياكى <hi rend="bold">1 - ئاينىڭ 29 - كۈنى،</hi> مىلادى تەقۋىمىگە كۆرە يىلنىڭ 29 - كۈنىدۇر. يىل سوڭىغا 336 (<ref target="https://ug.wikipedia.org/wiki/كەبىسە_يىلى">كەبىسە يىللارى</ref> 337) كۈن بار.</p>
